	if(document.getElementById("save_map").checked == true)
	{
		if(trim(document.getElementById("save_map_as").value) == '')
		{
			alert(alert_arr.ERR_SAVE_MAP);
			document.getElementById("save_map_as").focus();
			return false;
		}
	}

	return true;
